(18, 1, 'wp_yoast_notifications', 'a:6:{i:0;a:2:{s:7:\"message\";s:1210:\"Мы заметили, вы используете Yoast SEO  в течение некоторого времени; мы надеемся, что вы любите его! Мы были бы в восторге, если вы могли бы <a href=\"https://yoa.st/rate-yoast-seo?utm_content=6.0\"> дать нам 5 звезд рейтинга на WordPress.org</a>!\n\nЕсли у вас возникли проблемы, <a href=\"https://yoa.st/bugreport?utm_content=6.0\"> предоставьте отчет об ошибке </a> и мы сделаем все возможное, чтобы помочь вам.\n\nКстати, знаете ли вы, у нас также есть <a href=\'https://yoa.st/premium-notification?utm_content=6.0\'>Премиум плагин</a>? Он предлагает расширенные функции такие как переадресация и поддержка нескольких ключевых слов. Он поставляется с 24/7 личной поддержкой.\n\n<a class=\"button\" href=\"http://stolowka.moscow/wp-admin/?page=wpseo_dashboard&yoast_dismiss=upsell\"> Не показывать это уведомление больше </a>\";s:7:\"options\";a:8:{s:4:\"type\";s:7:\"warning\";s:2:\"id\";s:19:\"wpseo-upsell-notice\";s:5:\"nonce\";N;s:8:\"priority\";d:0.8000000000000000444089209850062616169452667236328125;s:9:\"data_json\";a:0:{}s:13:\"dismissal_key\";N;s:12:\"capabilities\";s:20:\"wpseo_manage_options\";s:16:\"capability_check\";s:3:\"all\";}}i:1;a:2:{s:7:\"message\";s:344:\"Yoast SEO and WooCommerce can work together a lot better by adding a helper plugin. Please install Yoast WooCommerce SEO to make your life better. <a href=\"https://yoa.st/1o0?utm_content=6.0\" aria-label=\"Больше информации о Yoast WooCommerce SEO\" target=\"_blank\" rel=\"noopener noreferrer\">Больше информации</a>.\";s:7:\"options\";a:8:{s:4:\"type\";s:7:\"warning\";s:2:\"id\";s:44:\"wpseo-suggested-plugin-yoast-woocommerce-seo\";s:5:\"nonce\";N;s:8:\"priority\";d:0.5;s:9:\"data_json\";a:0:{}s:13:\"dismissal_key\";N;s:12:\"capabilities\";a:1:{i:0;s:15:\"install_plugins\";}s:16:\"capability_check\";s:3:\"all\";}}i:2;a:2:{s:7:\"message\";s:562:\"Yoast SEO and Advanced Custom Fields can work together a lot better by adding a helper plugin. Please install <a href=\"http://stolowka.moscow/wp-admin/update.php?action=install-plugin&amp;plugin=acf-content-analysis-for-yoast-seo&amp;_wpnonce=3b750f2924\">ACF Content Analysis for Yoast SEO</a> to make your life better. <a href=\"https://wordpress.org/plugins/acf-content-analysis-for-yoast-seo/\" aria-label=\"Больше информации о ACF Content Analysis for Yoast SEO\" target=\"_blank\" rel=\"noopener noreferrer\">Больше информации</a>.\";s:7:\"options\";a:8:{s:4:\"type\";s:7:\"warning\";s:2:\"id\";s:41:\"wpseo-suggested-plugin-yoast-acf-analysis\";s:5:\"nonce\";N;s:8:\"priority\";d:0.5;s:9:\"data_json\";a:0:{}s:13:\"dismissal_key\";N;s:12:\"capabilities\";a:1:{i:0;s:15:\"install_plugins\";}s:16:\"capability_check\";s:3:\"all\";}}i:3;a:2:{s:7:\"message\";s:235:\"Не пропустите свои ошибки индексирования: <a href=\"http://stolowka.moscow/wp-admin/admin.php?page=wpseo_search_console&tab=settings\">подключитесь к Google Search Console здесь</a>.\";s:7:\"options\";a:8:{s:4:\"type\";s:7:\"warning\";s:2:\"id\";s:17:\"wpseo-dismiss-gsc\";s:5:\"nonce\";N;s:8:\"priority\";d:0.5;s:9:\"data_json\";a:0:{}s:13:\"dismissal_key\";N;s:12:\"capabilities\";s:20:\"wpseo_manage_options\";s:16:\"capability_check\";s:3:\"all\";}}i:4;a:2:{s:7:\"message\";s:416:\"У вас в WordPress, до сих пор установлено название сайта по умолчанию. Наверно лучше сделать его пустым, чем как сейчас. <a href=\"http://stolowka.moscow/wp-admin/customize.php?url=http%3A%2F%2Fyush25um.bget.ru%2Fwp-admin%2Fnav-menus.php\"> вы всегда можете исправить его в настройщике </a>.\";s:7:\"options\";a:8:{s:4:\"type\";s:5:\"error\";s:2:\"id\";s:28:\"wpseo-dismiss-tagline-notice\";s:5:\"nonce\";N;s:8:\"priority\";d:0.5;s:9:\"data_json\";a:0:{}s:13:\"dismissal_key\";N;s:12:\"capabilities\";s:20:\"wpseo_manage_options\";s:16:\"capability_check\";s:3:\"all\";}}i:5;a:2:{s:7:\"message\";s:397:\"<strong>Серьёзная проблема для SEO: Вы блокируете доступ для поисковых роботов.</strong> Вы должны <a href=\"http://stolowka.moscow/wp-admin/options-reading.php\">зайти в Настройки чтения</a> и убрать галочку рядом с пунктом \"Видимость для поисковых систем\".\";s:7:\"options\";a:8:{s:4:\"type\";s:5:\"error\";s:2:\"id\";s:32:\"wpseo-dismiss-blog-public-notice\";s:5:\"nonce\";N;s:8:\"priority\";i:1;s:9:\"data_json\";a:0:{}s:13:\"dismissal_key\";N;s:12:\"capabilities\";s:20:\"wpseo_manage_options\";s:16:\"capability_check\";s:3:\"all\";}}}'),
